static const mxArray *get_sim_state_c25_JointSpaceControl
  (SFc25_JointSpaceControlInstanceStruct *chartInstance)
{
  const mxArray *c25_st;
  const mxArray *c25_y = NULL;
  int32_T c25_i0;
  real_T c25_u[6];
  const mxArray *c25_b_y = NULL;
  uint8_T c25_hoistedGlobal;
  uint8_T c25_b_u;
  const mxArray *c25_c_y = NULL;
  real_T (*c25_ddq)[6];
  c25_ddq = (real_T (*)[6])ssGetOutputPortSignal(chartInstance->S, 1);
  c25_st = NULL;
  c25_st = NULL;
  c25_y = NULL;
  sf_mex_assign(&c25_y, sf_mex_createcellarray(2), FALSE);
  for (c25_i0 = 0; c25_i0 < 6; c25_i0++) {
    c25_u[c25_i0] = (*c25_ddq)[c25_i0];
  }

  c25_b_y = NULL;
  sf_mex_assign(&c25_b_y, sf_mex_create("y", c25_u, 0, 0U, 1U, 0U, 1, 6), FALSE);
  sf_mex_setcell(c25_y, 0, c25_b_y);
  c25_hoistedGlobal = chartInstance->c25_is_active_c25_JointSpaceControl;
  c25_b_u = c25_hoistedGlobal;
  c25_c_y = NULL;
  sf_mex_assign(&c25_c_y, sf_mex_create("y", &c25_b_u, 3, 0U, 0U, 0U, 0), FALSE);
  sf_mex_setcell(c25_y, 1, c25_c_y);
  sf_mex_assign(&c25_st, c25_y, FALSE);
  return c25_st;
}

static void set_sim_state_c25_JointSpaceControl
  (SFc25_JointSpaceControlInstanceStruct *chartInstance, const mxArray *c25_st)
{
  const mxArray *c25_u;
  real_T c25_dv0[6];
  int32_T c25_i1;
  real_T (*c25_ddq)[6];
  c25_ddq = (real_T (*)[6])ssGetOutputPortSignal(chartInstance->S, 1);
  chartInstance->c25_doneDoubleBufferReInit = TRUE;
  c25_u = sf_mex_dup(c25_st);
  c25_emlrt_marshallIn(chartInstance, sf_mex_dup(sf_mex_getcell(c25_u, 0)),
                       "ddq", c25_dv0);
  for (c25_i1 = 0; c25_i1 < 6; c25_i1++) {
    (*c25_ddq)[c25_i1] = c25_dv0[c25_i1];
  }

  chartInstance->c25_is_active_c25_JointSpaceControl = c25_f_emlrt_marshallIn
    (chartInstance, sf_mex_dup(sf_mex_getcell(c25_u, 1)),
     "is_active_c25_JointSpaceControl");
  sf_mex_destroy(&c25_u);
  c25_update_debugger_state_c25_JointSpaceControl(chartInstance);
  sf_mex_destroy(&c25_st);
}

